import React from 'react';
import '../Images/ufoInSF.png'
import Education from './Profile/Education';
import Languages from './Profile/Languages';
import Experience from './Profile/Experience';
import { Switch, Route, NavLink, Redirect, RouteComponentProps } from 'react-router-dom';
import '../app.css';

interface IProps {
  studies: Array<Studies> | undefined

}

const Profile: React.SFC<RouteComponentProps> | React.SFC<IProps> = (props: any) => {
  console.log(props.studies)
  const lStyles: string = "sp br-pill bb link dim dark-gray f6 f5-ns dib hover-bg-light-";
  return (
    <section className="mw8 center avenir">
      <nav className="tc w-100 border-box">
        <NavLink to={`${props.match.url}/languages`} activeClassName="act1" className={`${lStyles}green`}>Languages</NavLink>
        <NavLink to={`${props.match.url}/education`} activeClassName="act2" className={`${lStyles}yellow`}>Education</NavLink>
        <NavLink to={`${props.match.url}/experience`} activeClassName="act3" className={`${lStyles}blue`}>Experience</NavLink>
      </nav>
      <Switch>
        <Route exact path={`${props.match.path}`} render={() => <Redirect to={`${props.match.path}/languages`} />}/>
        <Route path={`${props.match.path}/languages`} render={() => <Languages />}/>
        <Route path={`${props.match.path}/education`} render={() => <Education />}/>
        <Route path={`${props.match.path}/experience`} render={() => <Experience />}/>
      </Switch>
    </section>  
  );
}

export default Profile;
